import React from 'react';
import Leftlogos from './Components/Leftlogos.jsx';
import "./CSS/App.css";
import Homecomponent from './Components/Homecomponent.jsx';


function App() {
  return (
    <div className='main'>

      <div className='sub1'>
          <Leftlogos />
      </div>

      <div className='sub2'>
        <div >
            <Homecomponent />
        </div>
      </div>
    </div>
  );
}

export default App;
